export default function ElevatorPitch() {
    return (
        <section>
            <p>Need someone who can help your users make the most of your technology? I'm pretty good at that.</p>
            <p>Technical support?</p> 
            <p>Sure! Technical writing? Yup.</p>
            <p>Content &amp; product strategy? Those too.</p> 
            <p>And, I'm not a bad programmer either.</p>
            <p>I'm user focused, and data driven. I'm ideally placed to both support users and speak truth to product. </p>
        </section>
    )
}
